import React, { Fragment, useEffect } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { getOwners } from '../../actions/OwnerProfile';

const Owners = ({ getOwners, OwnerProfile: { getProfiles, loading } }) => {
  useEffect(() => {
    getOwners();
  }, []);

  return <div>Owners</div>;
};

Owners.propTypes = {
  getOwners: PropTypes.func.isRequired,
  getProfiles: PropTypes.object.isRequired
};

const mapStateToProp = state => ({
  getProfiles: state.profile
});

export default connect(mapStateToProp, { getOwners })(Owners);
